import React from 'react'
import './asset/css/App.css';
import Table from './components/Table';


function App() {

  return (
    <div className="App">
      <nav>
        <div>
          <a className="navbar-brand text.uppercase" href="/">Rick and Morty Challenge</a>
        </div>
      </nav>  
      <Table/> 
    </div>
  );
}

export default App;
